import './GlobalNav.css';
const menu = [
    {
    name: "Home",
    path: "/",
    },
    {
    name: "About",
    path: "/about.html",
    },
    {
    name: "Cats",
    path: "/cats.html",
    },
    ];

function GlobalNav({ className, onNav }){
    const list = menu.map( item => {
        return (
            <ul className='global_nav'>
                <button>Navigation</button>
                <ul className='global_nav__bar'>
                    <li className="global-nav__item" key={item.name}>
                        <a onClick={onNav} className="global-nav__link" href={item.path} data-target={item.name}>
                            {item.name}
                        </a>
                    </li>
                </ul>
            </ul>
        );
    });
    return (
        <nav className={`global-nav ${className}`}>
            <ul className="global-nav__list">
            { list }
            </ul>
        </nav>
    );
}

export default GlobalNav;
